import React, { useState, useEffect } from 'react';
import api from '../../utils/api';
import './DailyScorePopup.scss';  // Import the SCSS styles

const DailyScorePopup = ({ closePopup }) => {
  const [dailyData, setDailyData] = useState(null);
  const [error, setError] = useState(null);
  const [loading, setLoading] = useState(true);

  // Function to call the /process-daily-data API
  const fetchDailyData = async () => {
    const driver_id = localStorage.getItem('driver_id');
    if (!driver_id) {
      setError('Driver ID not found. Please log in.');
      setLoading(false);
      return;
    }

    try {
      const response = await api.post('/process-daily-data', { driver_id });
      setDailyData(response.data);  // Store the API response in state
      setError(null);
    } catch (err) {
      console.error('Error fetching daily data:', err);
      setError('Failed to fetch daily data. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  // Fetch data when the component mounts
  useEffect(() => {
    fetchDailyData();
  }, []);

  return (
    <div className="daily-score-popup">
      <button className="close-button" onClick={closePopup}>Close</button>

      {/* Display loading state */}
      {loading && <p>Loading daily data...</p>}

      {/* Display error message */}
      {error && <p className="error">{error}</p>}

      {/* Display daily data in a structured format */}
      {dailyData && (
        <div>
          <h3>Daily Driving Summary</h3>
          <div className="summary-item">
            <strong>Driving Score:</strong> {dailyData.driving_score} / 100
          </div>
          <div className="summary-item">
            <strong>Driving Category:</strong> {dailyData.driving_category}
          </div>
          <div className="summary-item">
            <strong>Total Distance Covered:</strong> {dailyData.total_distance_covered_km} km
          </div>
          <div className="summary-item">
            <strong>Total Trips:</strong> {dailyData.total_trips}
          </div>
          <h4>Aggregated Data:</h4>
          <div className="summary-item">
            <strong>Acceleration:</strong> {dailyData.aggregated_data['Acceleration(m/s^2)']} m/s²
          </div>
          <div className="summary-item">
            <strong>Braking Intensity:</strong> {dailyData.aggregated_data['Braking_Intensity']}
          </div>
          <div className="summary-item">
            <strong>Heading Change:</strong> {dailyData.aggregated_data['Heading_Change(degrees)']} degrees
          </div>
          <div className="summary-item">
            <strong>Jerk:</strong> {dailyData.aggregated_data['Jerk(m/s^3)']} m/s³
          </div>
          <div className="summary-item">
            <strong>SASV:</strong> {dailyData.aggregated_data['SASV']}
          </div>
          <div className="summary-item">
            <strong>Speed (km/h):</strong> {dailyData.aggregated_data['Speed(km/h)']} km/h
          </div>
          <div className="summary-item">
            <strong>Speed Violation:</strong> {dailyData.aggregated_data['Speed_Violation']}
          </div>
        </div>
      )}
    </div>
  );
};

export default DailyScorePopup;
